func cleanTelemetry(e Entity) {
	switch e := e.(type) {
	case *entity:
		e.cleanTelemetry()
	}
}

func entityCopy(e Entity) *tdtl.JSONNode {
	switch e := e.(type) {
	case *entity:
		return e.state.Copy()
	}
	return nil
}

