func p(fn func()) time.Duration {
	cup, _ := os.OpenFile(fmt.Sprintf("profile.%d.cpu", time.Now().Unix()), os.O_CREATE|os.O_RDWR, 0o644)
	defer cup.Close()
	pprof.StartCPUProfile(cup)
	defer pprof.StopCPUProfile()

	mem, err := os.Create(fmt.Sprintf("profile.%d.mem", time.Now().Unix()))
	if err != nil {
		log.Fatal("could not create memory profile: ", err)
	}
	defer mem.Close() // error handling omitted for example
	runtime.GC()
	start := time.Now()
	fn() // get up-to-date statistics
	ret := time.Since(start)
	if err := pprof.WriteHeapProfile(mem); err != nil {
		log.Fatal("could not write memory profile: ", err)
	}
	return ret
}

